    {nome: 'Liderança em desing', src: livros, id:1},
    {nome: 'Cangaceiro JavaScript: Uma aventura no sertão da programação.', src: livros, id:2},
    {nome: 'Apache Kafka e Spring Bot', src: livros, id:3}
]
